import '../styles/App.css';
import BloqueCategoria from '../components/BloqueCategoria';

function App() {
  return (
    <div className="App">
      <h1>Grupo - 3</h1>
      <img src="./assets/Prueba.jpeg" alt="perrito" />
      <BloqueCategoria />
    </div>
  );
}

export default App;
